import React from "react";
import Head from "next/head";

const Singup = () => {
  return;
  <>
    <Head>
      <meta charSet="utf-8" />
      <title>노드버드</title>
    </Head>
    <div>회원가입 페이지</div>
  </>;
};

export default Singup;

